    border: none;
    padding: 0;
    background: transparent;
    text-align: center;
  }
  
  .files {
    position: relative;
  }
  
  .files:after {
    pointer-events: none;
    position: absolute;
    top: 60px;
    left: 0;
    width: 70px;
    right: 0;
    height: 70px;
    content: "";
    background-image: url(https://image.flaticon.com/icons/svg/130/130993.svg);
