    color: #000000;
    opacity: 1;
    font-weight: bold;
  }
  input.form-control.file-input {
    opacity: 0;
  }
  .pb {
    padding-bottom: 50px;
  }
  .files:hover {
    background: #dde2e8;
  }
  .files:focus {
    border: 3px solid #67aeec;
    /* opacity: 0.06; */
